import React,{Component}from 'react';
import axios from 'axios';
{/* <button href="https://http://localhost:3000/Request"/> */}
export default class createUser extends Component{
    constructor(props){
        super(props);
        this.onsubmit=this.onsubmit.bind(this);
        this.state={
            Request:''
        }
    }

    onsubmit(e){
        axios.get('http://localhost:3000/Request/')
            .then(res=>{this.setState({Request:res.data})})
            .catch(err=>console.log("signup err"+err));
    }
    render(){
        return(
        <div>
            {this.state.Request}
            <button type="submit" className="btn btn-outline-primary btn-block">Send Request</button>
        </div>
        )
    }
}
